import React from 'react';

const Widget = ({ title, temperature, windSpeed, city, windDirection, showWind }) => {

    const windInfo = windDirection + ' ' + windSpeed;
    return (
        <table className="ui two very basic column table">
            <tbody>
                <tr>
                    <td>
                        <h5>{title}</h5>
                    </td>
                </tr>
                <tr>
                    <td>
                        temp: {temperature}
                        <br />
                        city: {city}
                    </td>
                    <td>
                        {
                            showWind &&
                            ((<label>Wind  </label>), { windInfo })
                        }
                    </td>
                </tr>
            </tbody>
        </table>
    );
};

export default Widget;
